GameData["ui_ext"]["ui_info"]["help_text_list"]["text_01"] = [[$16003761]] -- - Walker Vehicle, Relic Unit, Huge Daemonic Engine of destruction.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_02"] = [[$16003762]] -- - Relatively slow moving, but has devastating melee potential and can sustain unbelievable amounts of damage.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_03"] = [[$16003763]] -- - Because of its size it is not affected by covers, it is too slow to summon, and it cannot deepstrike or enter portals.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_04"] = [[$16003764]] -- - It has a very good sight range and can detect nearby infiltrators, as no soul remains hidden from it.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_05"] = [[$16003765]] -- - With each sword strike it leeches health as it feeds upon the souls of enemies, and its mere sight cripples enemy morale.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_06"] = [[$16003766]] -- - As an amalgamation of daemon and machine, it cannot be repaired but is infused with superior regeneration.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_07"] = [[$16003767]] -- - On its destruction, Hellfire leaks and damages everyone in an wide radius around the Soul Grinder.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_08"] = [[$16003768]] -- - Cannot be summoned simultaneously with the Hell Spawn, as Chaos allows only one Relic Unit.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_09"] = [[$16003769]] -- - Extremely effective against all targets in melee.
GameData["ui_ext"]["ui_info"]["icon_name"] = [[daemons_icons/daemons_soul_grinder_icon]]
